import React from 'react'
import { useHashEmoji } from 'react-emoji-hash'

const App = () => {
  state = {
    search : ''
  }

  const example = useHashEmoji('ahmetozantekin');
  return (
    <div>
      <input onChange={this.searchText} value={this.state.search} type="text" placeholder="Enter a movie name" />
      {example}
    </div>
  )
}
export default App
